    true,nt"url": null,nt"notes": "The National Assessment of Educational Progress,
    2005 (NAEP 2005), is a study that is part of the National Assessment of Educational
    Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
    NAEP 2005 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
    assesses what America's students know and can do in various subject areas. The study
    was conducted using computer-based assessment of students. Students in grade 4,
    8, and 12 were sampled. NAEP 2005 assessments consist of national and state assessments
    in mathematics, reading, and science. The studyufffdufffds response rate was between
    84 and 99 percent. Key statistics produced from NAEP 2005 are results on subject-matter
    achievement, instructional experiences, and school environment for populations of
    students (e.g., all fourth-graders) and groups within those populations (e.g., female
    students, Hispanic students).",nt"owner_org": "8c0bc869-1189-4ced-af26-2abd2337b886",nt"extras":
